import React, { useState, useEffect } from "react";
import axios from "axios";
import { useParams, useNavigate } from "react-router-dom";

export default function EditUser() {
  const { id } = useParams();
  const navigate = useNavigate();

  const [marks, setMark] = useState({
      _id: "",
      studentId: "",
      subjectId: "",
      subjectName: "",
      mark: "",
      grade: ""
  });

  useEffect(() => {
      getMark();
  }, []); // Include `id` as a dependency

  function getMark() {
    axios.get(`http://localhost:80/api - Original - Copy/marks/${id}`).then(function(response) {
        console.log('API response:', response.data);
        const markToUpdate = response.data.find(marks => marks._id.$oid === id);
        setMark(markToUpdate);
    });
}



  const handleChange = (event) => {
      const { name, value } = event.target;
      setMark((prevMark) => ({
          ...prevMark,
          [name]: value
      }));
  };

  const handleSubmit = (event) => {
      event.preventDefault();

      const { _id, ...markToUpdate } = marks; // Exclude _id property

      axios.put(`http://localhost:80/api - Original - Copy/user/${marks._id.$oid}`, mark)
      .then(function(response) {
          console.log(response.data);
          navigate("/");
      });
      
  };

    return (
        <div>
            <h1>Edit Mark</h1>
            <form onSubmit={handleSubmit}>
                <table cellSpacing="10">
                    <tbody>
                        <tr>
                        <th>
                                <label>Student ID: </label>
                            </th>
                            <td>
                                <input
                                    type="text"
                                    name="studentId"
                                    value={marks.studentId}
                                    onChange={handleChange}
                                />
                            </td>
                        </tr>
                        <tr>
                        <th>
                                <label>Subject ID: </label>
                            </th>
                            <td>
                                <input
                                    type="text"
                                    name="subjectId"
                                    value={marks.subjectId}
                                    onChange={handleChange}
                                />
                            </td>
                        </tr>
                        <tr>
                        <th>
                                <label>Subject Name: </label>
                            </th>
                            <td>
                                <input
                                    type="text"
                                    name="subjectName"
                                    value={marks.subjectName}
                                    onChange={handleChange}
                                />
                            </td>
                        </tr>
                        <tr>
                        <tr>
                        <th>
                                <label>Mark: </label>
                            </th>
                            <td>
                                <input
                                    type="text"
                                    name="mark"
                                    value={marks.mark}
                                    onChange={handleChange}
                                />
                            </td>
                        </tr>
                        <tr>
                        <th>
                                <label>Grade: </label>
                            </th>
                            <td>
                                <input
                                    type="text"
                                    name="grade"
                                    value={marks.grade}
                                    onChange={handleChange}
                                />
                            </td>
                        </tr>
                            <td colSpan="2" align="right">
                                <button type="submit">Save</button>
                            </td>
                        </tr>
                    </tbody>
                </table>
            </form>
        </div>
    );
}
